import React from 'react';
import Item from '../Item/Item';

const ItemList = ({firstItem}) => (<ol>
    <li> <Item firstItem = {firstItem}/> </li>
    <li> <Item/> </li>
    <li> <Item/> </li>
    <li> <Item/> </li>
    <li> <Item/> </li>
    <li> <Item/> </li>
</ol>);

export default ItemList;
